화이트 하트 레인에서 발생한 방화범과 구장 침입자를 추적하면서, 토트넘은 모리시오 포체티노에게 시즌을 바꿀 수 있는 전환점을 발견한 것 같습니다. 바클레이스 프리미어 리그의 대부분의 팀들이 그러하듯, 이번 시즌은 매우 불안정합니다. 그러나 스퍼스 감독은 8일 동안 3번째 승리를 거둬냈습니다. 이전에 파르티잔 벨그라드와 10인 헐 시티와 경기한 것보다 이번 경기는 더욱 의미 있는 승리였습니다. 케빈 미랄라스가 골을 넣어 에버턴이 선제골을 기록하자, 후반전 초반에는 크리스티안 에릭센이 타임 하워드의 세이브에서 리바운드 골로 동점으로 만들었습니다. 후반전에는 로베르토 솔다도가 2-1로 앞서 나갔습니다.
@highlight
케빈 미랄라스가 박스 밖에서 멋진 골을 넣어 에버턴이 선제골을 기록합니다.
@highlight
토트넘은 크리스티안 에릭센의 리바운드 골로 동점을 만들었습니다. 타임 하워드가 해리 케인의 슛을 막은 후, 그는 이를 활용해 골망에 넣었습니다.
@highlight
3월 이후 리그에서 득점하지 못한 로베르토 솔다도가 전반전 종료 직전에 타임 하워드를 제압하며 2-1로 앞서 나갑니다.
@highlight
이번 승리로 토트넘은 프리미어 리그 7위에 올라서며, 10위인 에버턴보다 3점 앞서 있습니다. 
두 번째 질문에서 placeholder는 무엇을 가리키나요?

